def newman_prime(n):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def newman_shanks_williams(n):
        if n == 0:
            return 1
        return 2 * newman_shanks_williams(n - 1) - newman_shanks_williams(n - 2)

    count = 0
    i = 0
    while count < n:
        nsw = newman_shanks_williams(i)
        if is_prime(nsw):
            count += 1
        i += 1
    return nsw

